import React, { Component } from "react";
import { connect } from "react-redux";
import logo from "../../assets/images/logo.png";

import {
  NavbarStyle,
  LogoContainer
} from "../../assets/components/layout/Navbar.style";

class Navbar extends Component {
  render() {
    return (
      <NavbarStyle>
        <LogoContainer>
          <span className="brand-name">Stellar dashboard</span>

          <div className="">
            <i class="material-icons">menu</i>
          </div>
        </LogoContainer>
      </NavbarStyle>
    );
  }
}

const mapStateToProps = state => {
  return {};
};

export default connect(
  mapStateToProps,
  null
)(Navbar);
